    name: 'update(Output, string, string, string, Models.OutputsUpdateOptionalParams)'
    children: []
    type: method
    langs:
      - typeScript
    summary: Actualiza una salida existente en un trabajo de streaming existente. Esto puede usarse para actualizar parcialmente (es decir. actualizar las propiedades de uno o dos) una salida sin afectar al resto de la definición de trabajo o de salida.
    syntax:
      content: 'function update(output: Output, resourceGroupName: string, jobName: string, outputName: string, options?: Models.OutputsUpdateOptionalParams)'
      parameters:
        - id: output
          type:
            - '@azure/arm-streamanalytics.Output'
          description: 'Un objeto de salida. Las propiedades especificadas aquí sobrescribirá las propiedades correspondientes en la salida existente (es decir. Estas propiedades se actualizará). Las propiedades que se establecen en null aquí, significará que la propiedad correspondiente en la salida existente se siguen siendo los mismos y no cambiar como resultado de esta operación de revisión.'
        - id: resourceGroupName
          type:
            - string
          description: Nombre del grupo de recursos que contiene el recurso. Puede obtener este valor en la API del Administrador de recursos o el portal de Azure.
        - id: jobName
          type:
            - string
          description: El nombre del trabajo de streaming.
        - id: outputName
          type:
            - string
          description: El nombre de la salida.
        - id: options
          type:
            - Models.OutputsUpdateOptionalParams
          description: ''
          optional: true
      return:
        type:
          - Promise<Models.OutputsUpdateResponse>
    package: '@azure/arm-streamanalytics'
